import data from './data/Wine-Data.json'

function App() {

  return (
    <div className="App">
      <h1>Wine Data</h1>
      <table>
      <tr>
                    <th>Name</th>
                    <th>Age</th>
                    <th>Gender</th>
                </tr>
      </table>
    </div>
  );
}

export default App;
